		 from{ bottom:-100px; opacity:0 } 
		 to{ bottom:0; opacity:1 }

	.lost {
		animation: lost 0.5s 1 forwards;
	}
	
	@keyframes lost {
		100% {opacity: 0;}
	}
	
	#egg {
		position: absolute;
		margin: 80% 0% 0% 30%;
		height: 30%;
		width: 40%;
		overflow: hidden;
		background-repeat: no-repeat;
		background-Size: 100% 100%;
		transform-origin: 50% 100%;
		display: none;
	}
	
	#egg.born {
		animation: egg-born 1s 1;
		display: block;
	}
	
	
	@keyframes egg-shake {
		81.25% {transform: rotate(0deg);}
		93.75% {transform: rotate(-5deg);}
		100% {transform: rotate(3deg);}
	}
	
	@keyframes egg-shake1 {
		81.25% {transform: rotate(0deg);}
		93.75% {transform: rotate(-5deg);}
		100% {transform: rotate(3deg);}
	}
	
	@keyframes egg-born {
		0% {transform: scale(0.45);}
		16.67% {transform: scale(0.45) rotate(-30deg);}
		50% {transform: scale(1.1) rotate(6deg);}
		83.33% {transform: scale(1);}
		100% {transform: rotate(0deg);}
	}
	
	#eggEffect {
		position: absolute;
		margin: 56% 0% 0% -4.5%;
		height: 60%;
		width: 105%;
		overflow: hidden;
		background-repeat: no-repeat;
		background-Size: 100% 100%;
		display: block;
		filter: brightness(1.1);
		transform-origin: 50% 80%;
		opacity: 0;
		animation: eggBornEffect 1s 1;
	}
	
	@keyframes eggBornEffect {
		0% {transform: scale(0.3); opacity: 1;}
		16.67% {transform: scale(0.3);}
		58.33% {transform: scale(1);}
		75% {opacity: 1;}
		100% {opacity: 0;}
	}
	
	#eggEffect.open-prize {
		z-index: 0;
		animation: openPrize 0.5s 1;
	}
	
	@keyframes openPrize {
		80% {opacity: 1;}
		90% {opacity: 0;}
	}

	}

	#collectButton.buttonAnimate, #startButton.buttonAnimate {
		display: block;
		animation: buttonShow 0.5s forwards;
	}
	
	@keyframes buttonShow {
		0% {transform: scale(0.2)}
		40% {transform: scale(1.2)}
		100% {transform: scale(1)}
	}
	
	#coin1 {
		position: absolute;
		margin: 100% 0% 0% 50%;
		height: 9%;
		width: 15%;
		overflow: hidden;
		animation: coin-in 0.3s infinite;
		background-repeat: no-repeat;
		background-size: 100%;
		display: none;
	}
	
	#coin2 {
		position: absolute;
		margin: 95% 0% 0% 30%;
		height: 9%;
		width: 15%;
		overflow: hidden;
		animation: coin-in 0.4s 0.3s infinite;
		background-repeat: no-repeat;
		background-size: 100%;
		display: none;
	}
	
	#coin3 {
		position: absolute;
		margin: 90% 0% 0% 40%;
		height: 9%;
		width: 15%;
		overflow: hidden;
		animation: coin-in 0.2s 0.4s infinite;
		background-repeat: no-repeat;
		background-size: 100%;
		display: none;
	}
	
	@keyframes coin-in {
		100% {margin: 18% 0% 0% 76%;}
	}

				eggAppear.play()
			}).catch(()=> {
			   
			})
		}
	}
	
	function main(){
	
		document.getElementById("loader").style.display = "none";
		
		var container = document.getElementById('container');
		container.style.display = "block";
		
		var widthToHeight = 0 ;
		var newWidth = window.innerWidth;
		var newHeight = window.innerHeight;
		
		sizeData(newWidth,newHeight);
		resize(newWidth,newHeight);	
	}
	
	var hammer = document.querySelector("#hammer");
	var egg = document.querySelector("#egg");
	var chargebar = document.querySelector("#chargebar");
	var bar = document.querySelector("#bar");
	var tap = document.querySelector("#tap");
	var firstPrize = document.querySelector("#firstPrize");
	var secondPrize = document.querySelector("#secondPrize");
	var secondPrizeEffect = document.querySelector("#secondPrizeEffect");
	var collectButton = document.querySelector("#collectButton");
	var eggEffect = document.querySelector("#eggEffect");
	var life1 = document.querySelector("#life1");
	var life2 = document.querySelector("#life2");
	var life3 = document.querySelector("#life3");
	var coinBurst = document.querySelector("#coinBurst");
	var bagNumber = document.querySelector("#bagNumber");
	var coinNumber = document.querySelector("#coinNumber");
	var smackEffect = document.querySelector("#smackEffect");
	var flameExplode = document.querySelector("#flameExplode");
	var glowScutter = document.querySelector("#glowScutter");
	var coin1 = document.querySelector("#coin1");
	var coin2 = document.querySelector("#coin2");
	var coin3 = document.querySelector("#coin3");
	var coinRain = document.querySelector("#coinRain");
	var bgm = document.getElementById("bgm");
	var hitEgg = document.getElementById("hitEgg");
	var eggCrackNone = document.getElementById("eggCrackNone");
	var lose = document.getElementById("lose");
	var eggCrackPet = document.getElementById("eggCrackPet");
	var eggAppear = document.getElementById("eggAppear");
	
	var counter = 0;
	var count = 0;
	var energy = 0;
	
	function charge() {
		energy = energy += 10;
		bar.style.width = energy + "%";
		console.log(energy);
		if (energy === 50) {
			count += 1;
			energy = 0;
			console.log(energy);
			bar.style.width = energy + "%";
			
			chargebar.style.display = "none";
			tap.style.display = "none";
			
			hammer.addEventListener("animationend", openEgg);
		}
	}
	
	function openEgg() {
		if (count !== 1) {
			eggbtm.classList.add("crack");
		}else {
			eggbtm.style.display = "block";
			eggEffect.classList.toggle("open-prize");
			eggCrackNone.play();
		}
		
		if (count === 2) {
			eggCrackPet.play();
		}
		
		if (count === 3) {
			eggCrackCoin.play();
		}
		
		eggtop.classList.add("crack");
		
		flameExplode.style.display = "block";
		flameExplode.addEventListener("animationend", hideFlame);
		
		eggtop.addEventListener("animationend", function() {
			eggtop.classList.remove("crack");
			prize();
		});
		
		if (eggbtm.classList.contains("crack")) {
			eggbtm.addEventListener("animationend", function() {
				eggbtm.classList.remove("crack");
			});
		}
		
		egg.style.display = "none";
		hammer.style.display = "none";
		hammer.removeEventListener("animationend", openEgg);
		lostChance();
		
	}
	
	function hideFlame() {
		flameExplode.style.display = "none";
		flameExplode.removeEventListener("animationend", hideFlame);
	}
	
	function lostChance() {
		if (count === 1) {
			life3.classList.toggle("lost");
		}else if (count === 2) {
			life2.classList.toggle("lost");
		}else if (count === 3) {
			life1.classList.toggle("lost");
		}
	}
	
	function prize() {
		if (count === 1) {
			firstPrize.style.display = "block";
			lose.play();
			lose.onended = function() {
				if (counter === 0){
					reset("clear");
					counter = 1;
				}
			}
		}else if (count === 2) {
			secondPrize.style.display = "block";
			secondPrizeEffect.style.display = "block";
			collectButton.classList.add("buttonAnimate");
		}else if (count === 3) {
			coinBurst.style.display = "block";
			glowScutter.style.display = "block";
			thirdPrize.style.display = "block";
			startButton.classList.add("buttonAnimate");
			coinNumber.style.animation = "coin-number 3.5s steps(26) forwards";
			
			coinBurst.addEventListener("animationend", function() {
				coinBurst.style.display = "";
			});
			glowScutter.addEventListener("animationend", function() {
				glowScutter.style.display = "";
				coin1.style.display = "block";
				coin2.style.display = "block";
				coin3.style.display = "block";
				coinRainny.style.display = "block";
				coinRainny.addEventListener("animationend", function() {
					coinRain.style.animationPlayState = "running";
				});
			});
			coinNumber.addEventListener("animationend", function() {
				coin1.style.display = "";
				coin2.style.display = "";
				coin3.style.display = "";
			});
		}
	}
	
	var hitToggle = 0;
	function hit() {
		if (hitToggle === 0) {
			hammer.style.animation = "hammer-hit 0.25s 1";
			egg.style.animation = "egg-shake 0.25s 1";
			hitToggle = 1;
		}else {
			hammer.style.animation = "hammer-hit1 0.25s 1";
			egg.style.animation = "egg-shake1 0.25s 1";
			hitToggle = 0;
		}

			smackEffect.classList.add("smack");
			
			smackEffect.addEventListener("animationend", noSmack);
			
			hitEgg.currentTime = 0;
			hitEgg.play();
	}
	
	
	function noSmack() {
		smackEffect.classList.remove("smack");
		smackEffect.removeEventListener("animationend", noSmack);
	}
	
	function reset(data) {
		if (data === "clear") {
			eggtop.style.display = "";
			eggbtm.style.display = "";
			firstPrize.style.display = "";
		}else if (data === "collectButton") {
			secondPrize.style.display = "";
			collectButton.style.animation = ""
			collectButton.classList.remove("buttonAnimate");
		}
		
		egg.style.display = "block";
		chargebar.style.display = "block";
		hammer.style.display = "block";
		
		hammer.style.animationName = "";
		egg.style.animation = "egg-born 1s 1";
		hammer.style.animationDuration = "1s";
		eggAppear.play();
	}
	
	function collect() {
		secondPrize.classList.add("collect");
		secondPrizeEffect.style.display = "";
		collectButton.style.animation = "click 0.5s 1"
		
		secondPrize.addEventListener("animationend", function() {
			reset("collectButton");
			bagNumber.style.animation = "bag-number 0.1s steps(1) forwards";
		});
		click.play();
	}
	
	function mouseDown(e) {
		var data = e.target.id;
		console.log(data);
		
		if (data === "hammer") {
			hit();
			charge();
		}
		
		if (data === "collectButton") {
			collect();
		}
		
		if (data !== "" && firstPrize.style.display === "block" && counter === 0) {
			reset("clear");
			counter = 1;
		}
	}
	
	
	
	
	
	function sizeData(w,h){
	
		var newWidth = w;
		var newHeight = h;
		// watch
		if ( newWidth === newHeight ){ widthToHeight = 1 / 1;}
		else if ( newWidth === 320 && newHeight === 325){widthToHeight = 65 / 64;}
		else if ( newWidth === 320 && newHeight === 330){widthToHeight = 33 / 32;}
		else if ( newWidth === 320 && newHeight === 290){widthToHeight = 32 / 29;}
		else if (( newWidth === 272 && newHeight === 340)||( newWidth === 312 && newHeight === 390)){widthToHeight = 5/4;}
		// Ipad 1/2/3,Nexus 9
		else if ((newWidth === 1536 && newHeight === 2048)
				||(newWidth === 2732 && newHeight === 2048 )||(newWidth === 2048 && newHeight === 1536)){widthToHeight = 4 / 3;}
		// Chromebook Pixel,Iphone,Iphone 4, Surface Book
		else if ((newWidth === 320 && newHeight === 480) || (newWidth === 640 && newHeight=== 960)
				||(newWidth === 480 && newHeight === 320) || (newWidth === 960 && newHeight=== 640)
				||(newWidth === 2560 && newHeight=== 1700) ||(newWidth === 3000 && newHeight=== 2000)
				||(newWidth === 2160 && newHeight=== 1440) ||(newWidth === 2736 && newHeight=== 1824)){widthToHeight = 3 / 2;}
		// Chromobox 30, Dell Venue 8,MacBook 12, MAcbook Air 13,Macbook Pro 13, Macbook Pro 15
		// Nexus 15,Nexus 7, Samsung Galaxy Tab 10,Sony Xperia Z3/Z4 Tablet
		else if ((newWidth === 800 && newHeight===480) || (newWidth === 1280 && newHeight === 800)
				||(newWidth === 1440 && newHeight === 900) || (newWidth === 2880 && newHeight === 1800)
				||(newWidth === 1200 && newHeight === 1920) || (newWidth === 800 && newHeight === 1280)
				||(newWidth === 1920 && newHeight === 1200) || (newWidth === 2560 && newHeight === 1600)){widthToHeight = 16 / 10;}
		// Nexus 4
		else if (newWidth === 768 && newHeight === 1280){widthToHeight = 5 / 3;}
		// Android One,Chromebook 11, Google Pixel /XL,FTC One M8/M9, iMac 27/5K, Iphone5/6/6 Plus,LG G2/G3,
		// Surface /2/3/Pro/Sony Xperia Z1 Ultra/Z1 Compact/Z2/Z3/Z3 Compact/Sony Xperia C4,
		// Samsung Galaxy 4/S5/S6/S7/S7 Edge,Nexus 6P/Note, Mac Book Air 11 , Moto G/X/5/5X/6/6P
		else if ((newWidth === 720 && newHeight === 1280)||(newWidth === 1366 && newHeight === 768)
				||(newWidth === 5120 && newHeight === 2880)){widthToHeight = 9 / 16;}
		
		//Samsung Galaxy Tab 7
		else if (newWidth === 600 && newHeight===1024){widthToHeight = 10/16;}
		// Samsung Galaxy S8/S8+
		else if (newWidth === 1440 && newHeight===2960){widthToHeight = 18.5 / 9;}
		
		//
		else if (newWidth ===  1080 && newHeight===2160 ||newWidth ===  1440 && newHeight===2880 
				|| newWidth ===  411 && newHeight===823){widthToHeight = 9 / 18;}
		
		//Final
		//GalaxyS5 
		else if(newWidth === 1920 && newHeight === 1080){widthToHeight = 16 / 9;}	
		//iphone 5
		else if(newWidth === 640 && newHeight === 1136){widthToHeight = 40 / 71;}	
		//iphone 6,7,8 plus  //Google Pixel,Google Pixel XL 169
		else if (newWidth === 414 && newHeight === 736 || newWidth === 375 && newHeight === 667 
				|| newWidth === 320 && newHeight === 568 || newWidth === 411 && newHeight === 731 
				|| newWidth === 360 && newHeight === 640  || newWidth === 1080 && newHeight === 1920
				|| newWidth === 750 && newHeight === 1334 ||newWidth === 1440 && newHeight === 2560) {widthToHeight = 9 / 16;}	
		//iphone X
		else if (newWidth === 375 && newHeight === 812 || newWidth === 1125 && newHeight === 2436){widthToHeight = 9 / 19.5;}
		//ipad, ipad Pro
		else if (newWidth === 768   && newHeight === 1024 || 
				 newWidth === 2048  && newHeight === 2732 || newWidth === 1024  && newHeight === 1366  ){widthToHeight = 3 / 4;}
		
		else{widthToHeight = 2.5 / 4;}
		
		return (newWidth,newHeight);
	}	
	
	function resize(w,h){
		
		var newWidth = w;
		var newHeight = h;
		
		var newWidthToHeight = newWidth / newHeight;
		if (newWidthToHeight > widthToHeight) {
			newWidth = newHeight * widthToHeight;
			container.style.height = newHeight + 'px';
			container.style.width = newWidth + 'px';
		} 
		else {
			newHeight = newWidth / widthToHeight;
			container.style.width = newWidth + 'px';
			container.style.height = newHeight + 'px';
		}
		var newWidthToHeight = newWidth / newHeight;
		if (newWidthToHeight > widthToHeight) {
			newWidth = newHeight * widthToHeight;
			container.style.height = newHeight + 'px';
			container.style.width = newWidth + 'px';
		} 
		else {
			newHeight = newWidth / widthToHeight;
			container.style.width = newWidth + 'px';
			container.style.height = newHeight + 'px';
		}
		container.style.fontSize = (newWidth / 400) + 'em';
	}
	
	 window.addEventListener("orientationchange", function() {location.reload();}, false);
     document.getElementById("x").innerHTML = "";
	 
	 
</script>
